import React from "react";

const wrapperStyle = {
	position: "relative",
	width: "100%"
};
const gradientStyle = {
	background: "linear-gradient(rgba(255, 255, 255, 0), rgba(0, 0, 0, 0.6))",
	position: "absolute",
	zIndex: "2",
	width: "100%",
	height: "100%"
};

export default function HeroVideo(props) {
	return (
		<div className="videoWrapper" style={wrapperStyle}>
			<div className="gradient" style={gradientStyle} />
			<div className="hero">
				<video className="hero-content media" autoPlay="autoplay" muted loop>
					<source src={props.src} type="video/mp4" />
				</video>
			</div>
		</div>
	);
}
